// src/pages/RegisterPage.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import '../css/Auth/SignUpPage.css';

function RegisterPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [passwordCheck, setPasswordCheck] = useState('');
  const [nickname, setNickname] = useState('');
  const [profileImage, setProfileImage] = useState(null);
  const [message, setMessage] = useState('');
  const [verificationCode, setVerificationCode] = useState('');
  const [isCodeSent, setIsCodeSent] = useState(false);
  const [isVerified, setIsVerified] = useState(false);
  const navigate = useNavigate();

  const handleRegister = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append('email', email);
    formData.append('password', password);
    formData.append('passwordCheck', passwordCheck);
    formData.append('nickname', nickname);
    formData.append('profileImage', profileImage);

    try {
      const response = await axios.post('http://localhost:8080/api/users/register', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });

      if (response.status === 200) {
        setMessage(response.data);
        setIsCodeSent(true);
      }
    } catch (error) {
      setMessage(error.response.data);
    }
  };

  const handleVerify = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:8080/api/users/verify', null, {
        params: {
          email,
          code: verificationCode
        }
      });

      if (response.status === 200) {
        setMessage(response.data);
        setIsVerified(true);
      }
    } catch (error) {
      setMessage(error.response.data);
    }
  };

  const handleCompleteRegistration = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append('email', email);
    formData.append('password', password);
    formData.append('nickname', nickname);
    formData.append('profileImage', profileImage);

    try {
      const response = await axios.post('http://localhost:8080/api/users/complete-registration', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });

      if (response.status === 200) {
        setMessage(response.data);
        navigate('/login');
        alert('회원가입에 성공하였습니다.');
      }
    } catch (error) {
      setMessage(error.response.data);
    }
  };

  const handleFileChange = (e) => {
    setProfileImage(e.target.files[0]);
  };

  return (
    <div className='signup-container'>
      <h2 className='clickable-home' onClick={() => navigate('/')}>RUNNING CREW</h2>
      <h2>회원가입</h2>
      {!isCodeSent ? (
        <form onSubmit={handleRegister} className='signup-form'>
          <div className='form-group'>
            <label>이메일:</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>
          <div className='form-group'>
            <label>비밀번호:</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>
          <div className='form-group'>
            <label>비밀번호 확인:</label>
            <input
              type="password"
              value={passwordCheck}
              onChange={(e) => setPasswordCheck(e.target.value)}
            />
          </div>
          <div className='form-group'>
            <label>닉네임:</label>
            <input
              type="text"
              value={nickname}
              onChange={(e) => setNickname(e.target.value)}
            />
          </div>
          <div className='form-group'>
            <label>프로필 사진:</label>
            <input
              type="file"
              id="profileImage"
              accept="image/*"
              onChange={handleFileChange}
            />
          </div>
          <button type="submit" className='signup-button'>완료</button>
        </form>
      ) : !isVerified ? (
        <form onSubmit={handleVerify} className='signup-form'>
          <div className='form-group'>
            <label>인증 코드:</label>
            <input
              type="text"
              value={verificationCode}
              onChange={(e) => setVerificationCode(e.target.value)}
            />
          </div>
          <button type="submit" className='signup-button'>인증</button>
        </form>
      ) : (
        <form onSubmit={handleCompleteRegistration} className='signup-form'>
          <button type="submit" className='signup-button'>회원가입 완료</button>
        </form>
      )}
      {message && <p>{message}</p>}
    </div>
  );
}

export default RegisterPage;
